  return (
    <div className="upcoming-events">
      <h2>Upcoming Events</h2>
      <ul>
        {events.map((event) => (
          <li key={event.id}>
            {
              (event.performers.length > 0) ?
              (<img src={event.performers[0].image} alt={event.name} />)
              : (<></>)
            }
            <h3>{event.title}</h3>
            {
              event.performers.map((performer) => (
                <p>{performer.name}</p>
              ))
            }
            <p>{event.venue.name + " " + event.venue.city}</p>
